import React from 'react';
import ReactDom from 'react-dom';
import Cards  from './Card';
import  './index.css';
import Sdata from './Sdata';

ReactDom.render(

    <>
      <h1 className="heading_style">List of 6 Netflix Best Series </h1>


    <Cards  
        imgsrc ={Sdata[0].imgsrc}
        title = {Sdata[0].title}
        sname = {Sdata[0].sname}
        links = {Sdata[0].links}
    />
     <Cards  
        imgsrc ={Sdata[1].imgsrc}
        title = {Sdata[1].title}
        sname = {Sdata[1].sname}
        links = {Sdata[1].links}
    />
     <Cards  
        title = {Sdata[2].title}
        imgsrc ={Sdata[2].imgsrc}
        sname = {Sdata[2].sname}
        links = {Sdata[2].links}
    />
      <Cards  
        imgsrc ={Sdata[3].imgsrc}
        title = {Sdata[3].title}
        sname = {Sdata[3].sname}
        links = {Sdata[3].links}
    />
     <Cards  
        imgsrc ={Sdata[4].imgsrc}
        title = {Sdata[4].title}
        sname = {Sdata[4].sname}
        links = {Sdata[4].links}
    />
     <Cards  
        imgsrc ={Sdata[5].imgsrc}
        title = {Sdata[5].title}
        sname = {Sdata[5].sname}
        links = {Sdata[5].links}
    />



    </>,  document.getElementById('root')  
);
